create table quotation_db (
	id INT,
	user_id INT,
	customer_name VARCHAR(50),
	customer_age INT,
	customer_gender VARCHAR(50),
	customer_income DECIMAL(10,2),
	customer_occupation VARCHAR(50),
	insurance_type VARCHAR(7),
	vehicle_type TEXT,
	risk_score DECIMAL(4,2),
	coverage_amount DECIMAL(15,2),
	monthly_premium DECIMAL(10,2),
	premium_term_months INT,
	terms_and_conditions VARCHAR(200),
	quote_status VARCHAR(20),
	payment_status VARCHAR(20),
	created_at DATE,
	updated_at DATE
);
